import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import Header from './components/layout/Header';

import './App.css';
import Axios from 'axios';

class App extends Component {
  state = {
    pokemons: [{ name: 'Pickachu' }],
  };

  loadPokemons() {
    Axios.get('https://pokeapi.co/api/v2/pokemon')
      .then((res) => res.json())
      .then((data) => this.setState({ name: data }));
  }

  render() {
    this.loadPokemons();
    console.log(this.state);
    return (
      <Router>
        <div className='App'>
          <Header />
          <Route
            exact
            path='/'
            render={() => (
              <React.Fragment>
                <div>Main page</div>
              </React.Fragment>
            )}
          />
          <Route
            path='/pokemons'
            render={() => (
              <React.Fragment>
                <div>Pok√©mons page</div>
              </React.Fragment>
            )}
          />
          <Route
            path='/types'
            render={() => (
              <React.Fragment>
                <div>Types page</div>
              </React.Fragment>
            )}
          />
        </div>
      </Router>
    );
  }
}

export default App;
